import React from 'react'
import reading from '../../assets/reading.svg'
const Analytics = () => {
  return (
    <div className="w-full bg-white py-16 px-4 mt-0">
        <div classname="max-w-[1240px] mx-auto grid md:grid-cols-2">
            <img src={reading} />
        </div>
    </div>
  )
}

export default Analytics
